-- ----------------------------
-- View structure for v_achievement
-- ----------------------------
DROP VIEW IF EXISTS `v_achievement`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `v_achievement` AS select `ba`.`ID` AS `ID`,`ba`.`BA_NAME` AS `BA_NAME`,`ba`.`BA_LONGITUDE` AS `BA_LONGITUDE`,`ba`.`BA_LATITUDE` AS `BA_LATITUDE`,`ba`.`BA_ENTRYTIME` AS `BA_ENTRYTIME`,`ba`.`BA_RANGE` AS `BA_RANGE`,`ba`.`BA_POINT` AS `BA_POINT`,`ba`.`SO_ID` AS `SO_ID`,`ba`.`IS_STATUS` AS `IS_STATUS`,`sai`.`SAI_NAME` AS `SAI_NAME`,`sf`.`ID` AS `SF_ID` from ((`bus_achievement` `ba` left join `sys_account_info` `sai` on((convert(`sai`.`SO_ID` using utf8mb4) = `ba`.`SO_ID`))) left join `sys_file` `sf` on(((`sf`.`SF_TABLE_NAME` = 'BUS_ACHIEVEMENT') and (convert(`sf`.`SF_TABLE_ID` using utf8mb4) = `ba`.`ID`) and (`sf`.`SF_SDI_CODE` = 2))));

-- ----------------------------
-- View structure for v_achievement_detail
-- ----------------------------
DROP VIEW IF EXISTS `v_achievement_detail`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `v_achievement_detail` AS select `bad`.`ID` AS `ID`,`bad`.`BA_ID` AS `BA_ID`,`bad`.`BW_ID` AS `BW_ID`,`bad`.`BAD_ADDRESS` AS `BAD_ADDRESS`,`bad`.`BAD_REMARKS` AS `BAD_REMARKS`,`bad`.`BAD_FILETYPE` AS `BAD_FILETYPE`,`bad`.`BAD_ENTERTIME` AS `BAD_ENTERTIME`,`ba`.`BA_NAME` AS `BA_NAME`,`bw`.`BW_USERNAME` AS `BW_USERNAME` from ((`bus_achievement_detail` `bad` join `bus_achievement` `ba` on((`ba`.`ID` = `bad`.`BA_ID`))) join `bus_wechat` `bw` on((`bw`.`ID` = `bad`.`BW_ID`)));

-- ----------------------------
-- View structure for v_activity
-- ----------------------------
DROP VIEW IF EXISTS `v_activity`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `v_activity` AS select `ba`.`ID` AS `ID`,`ba`.`BA_TITLE` AS `BA_TITLE`,`ba`.`BA_ENTRY_TIME` AS `BA_ENTRY_TIME`,`ba`.`BA_UPDATE_TIME` AS `BA_UPDATE_TIME`,`ba`.`IS_STATUS` AS `IS_STATUS`,`sai`.`SAI_NAME` AS `SAI_NAME`,`sf`.`ID` AS `SF_ID`,concat(`sf`.`SF_PATH`,'@@@',`sf`.`SF_NAME`) AS `IMG_PATH` from ((`bus_activity` `ba` left join `sys_account_info` `sai` on((convert(`sai`.`SO_ID` using utf8mb4) = `ba`.`SO_ID`))) left join `sys_file` `sf` on(((`sf`.`SF_TABLE_NAME` = 'BUS_ACTIVITY') and (convert(`sf`.`SF_TABLE_ID` using utf8mb4) = `ba`.`ID`) and (`sf`.`ID` = (select max(`sf`.`ID`) from `sys_file` `sf` where ((`sf`.`SF_SDT_CODE` = 'BUS_FILE_DEFAULT') and (convert(`sf`.`SF_TABLE_ID` using utf8mb4) = `ba`.`ID`)) group by `sf`.`SF_TABLE_ID`)))));

