CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `v_wechat` AS select `bw`.`ID` AS `ID`,`bw`.`SO_ID` AS `SO_ID`,`bw`.`BW_UUID` AS `BW_UUID`,`bw`.`BW_USERNAME` AS `BW_USERNAME`,`bw`.`BW_NICKNAME` AS `BW_NICKNAME`,`bw`.`BW_GENDER` AS `BW_GENDER`,`bw`.`BW_AVATAR` AS `BW_AVATAR`,`bw`.`BW_LOCATION` AS `BW_LOCATION`,`bw`.`BW_SOURCE` AS `BW_SOURCE`,`bw`.`BW_ACCESSTOKEN` AS `BW_ACCESSTOKEN`,`bw`.`BW_EXPIREIN` AS `BW_EXPIREIN`,`bw`.`BW_OPENID` AS `BW_OPENID`,`bw`.`BW_REFRESHTOKEN` AS `BW_REFRESHTOKEN`,`bw`.`BW_ENTRYTIME` AS `BW_ENTRYTIME`,`bw`.`BW_LOGINTIME` AS `BW_LOGINTIME`,`bw`.`IS_STATUS` AS `IS_STATUS`,ifnull(`bwd`.`CLOCKIN_COUNT`,0) AS `CLOCKIN_COUNT`,ifnull(`bwp`.`BWP_NUMBER`,0) AS `BWP_NUMBER` from ((`bus_wechat` `bw` left join `bus_wechat_praise` `bwp` on((`bwp`.`BW_ID` = `bw`.`ID`))) left join (select `bad`.`BW_ID` AS `BW_ID`,count(1) AS `CLOCKIN_COUNT` from (`bus_achievement_detail` `bad` join `bus_achievement` `ba` on(((`ba`.`ID` = `bad`.`BA_ID`) and (`ba`.`IS_STATUS` = 1)))) where (`bad`.`ID` = (select max(`ead`.`ID`) from `bus_achievement_detail` `ead` where ((`ead`.`BA_ID` = `bad`.`BA_ID`) and (`ead`.`BW_ID` = `bad`.`BW_ID`)) group by `ead`.`BA_ID`,`ead`.`BW_ID`)) group by `bad`.`BW_ID`) `bwd` on((`bwd`.`BW_ID` = `bw`.`ID`)));

SET FOREIGN_KEY_CHECKS = 1;
