INSERT INTO `sys_log_text` VALUES ('227196846789885952', '227196846705999872', 'SQL运行错误:sql injection violation, syntax error: syntax error, error in :\'     IFNULL(BWD.CLOCKIN_COUNT,0) CL\', expect RPAREN, actual LPAREN pos 293, line 10, column 24, token LPAREN : SELECT *\n        FROM(\n            SELECT CAST(@RANK := @RANK +1 AS SIGNED) AS WECHAT_RANK,BW.*\n            FROM\n            (SELECT @RANK := 0) r,\n            (SELECT\n                BW.ID,\n                BW.BW_USERNAME,BW.BW_AVATAR,\n                EAD.BAD_ENTERTIME\n                IFNULL(BWD.CLOCKIN_COUNT,0) CLOCKIN_COUNT,\n                BWP.BWP_NUMBER\n                FROM BUS_WECHAT BW\n                LEFT JOIN (SELECT BAD.BW_ID,COUNT(1) CLOCKIN_COUNT FROM BUS_ACHIEVEMENT_DETAIL BAD INNER JOIN BUS_ACHIEVEMENT BA\n                ON BA.ID = BAD.BA_ID AND BA.IS_STATUS = 1 WHERE BAD.ID =(SELECT MAX(EAD.ID) FROM BUS_ACHIEVEMENT_DETAIL EAD\n                WHERE EAD.BA_ID = BAD.BA_ID AND EAD.BW_ID = BAD.BW_ID GROUP BY EAD.BA_ID,EAD.BW_ID) GROUP BY BAD.BW_ID\n                )BWD ON BWD.BW_ID = BW.ID\n                LEFT JOIN BUS_ACHIEVEMENT_DETAIL EAD ON EAD.BW_ID = BW.ID AND EAD.ID = (SELECT MIN(EAD.ID) FROM\n                BUS_ACHIEVEMENT_DETAIL EAD WHERE EAD.BW_ID = BW.ID GROUP BY EAD.BW_ID) AND EAD.BA_ID IN(SELECT BA.ID FROM\n                BUS_ACHIEVEMENT BA WHERE BA.IS_STATUS = 1 )\n                LEFT JOIN BUS_WECHAT_PRAISE BWP ON BWP.BW_ID = BW.ID\n                ORDER BY BWD.CLOCKIN_COUNT DESC,BWP.BWP_NUMBER DESC,EAD.BAD_ENTERTIME ASC,BW.BW_ENTRYTIME ASC\n            )BW\n        )TEMP');
