INSERT INTO `sys_log_text` VALUES ('227335169617428480', '227335169592262656', '更新活动,更新前:{状态=启用, 录入时间=2019-12-12 23:23:43, 更新时间=2019-12-12 23:35:36, 活动内容=&lt;p&gt;&lt;strong&gt;体坛周报全媒体记者 宁穆&lt;/strong&gt;&lt;/p&gt;\n&lt;p&gt;在最后一轮和顿涅茨克矿工的比赛之前，不会有多少人相信，亚特兰大会成为欧冠十六强中的一员，感谢这支意大利球队，让本赛季欧冠淘汰赛真正变成了五大联赛的舞台。在加斯佩里尼带领着球队疯狂庆祝的同时，也有很多人回归现实给亚特兰大泼冷水，认为他们是淘汰赛中的大礼包，任何一支球队抽到他们都可以轻松晋级，但真的是这样吗？这支球队能否复制上赛季阿贾克斯的神奇？&lt;/p&gt;\n&lt;p&gt;&lt;img title=&quot;1576161264884097929.jpg&quot; src=&quot;https://ygx.mynatapp.cc/fileService/preview/QlVTX0FDVElWSVRZXDIwMTktMTItMTJcQEBAMjI3MzI4Mjk4MDE3ODgyMTEyLmpwZw==&quot; alt=&quot;21321.jpg&quot; width=&quot;640&quot; height=&quot;360&quot; data-width=&quot;640&quot; data-height=&quot;360&quot; /&gt;&lt;/p&gt;\n&lt;p&gt;贝尔加莫的所有球迷们至今还沉浸在亚特兰大出线的疯狂之中，他们为自己热爱的这支球队而自豪，更为整个意大利足坛出了这样一支神奇的队伍感到骄傲，他们不仅是意大利足坛这么多年在欧冠历史上的一个奇迹，同时也是整个欧冠史上的奇迹。毕竟在欧冠联赛的历史上还从未有过一支球队在前三轮比赛一分未得的情况下最终出线，亚特兰大人做到了，他们弥补了意大利足球的遗憾，也用自己的经历告诉着所有的欧冠门外汉们：只要相信奇迹，一切都可能发生。&lt;/p&gt;\n&lt;p&gt;这一夜这支蓝黑色的球队相比国际米兰在全世界吸了更多的粉丝，也获得了更高的知名度和尊重度，很多疯狂的球迷们已经开始期待，期待着这支球队可以效仿上赛季的阿贾克斯，一路高歌猛进，淘汰所有的豪门，走得更远。的确，上赛季的阿贾克斯确实给我们带来了奇迹，从淘汰皇家马德里到淘汰尤文图斯甚至险些杀入决赛，阿贾克斯的荷兰童话是否可以在亚特兰大身上重演？&lt;/p&gt;\n&lt;p&gt;&lt;img title=&quot;1576161259421068022.jpg&quot; src=&quot;https://ygx.mynatapp.cc/fileService/preview/QlVTX0FDVElWSVRZXDIwMTktMTItMTJcQEBAMjI3MzI4MzMyNjU4NjM4ODQ4LmpwZw==&quot; alt=&quot;213.jpg&quot; width=&quot;640&quot; height=&quot;341&quot; data-width=&quot;640&quot; data-height=&quot;341&quot; /&gt;&lt;/p&gt;\n&lt;p&gt;其实阿贾克斯与亚特兰大之间还是有太多的不同，这让两支球队在理论上并没有可比之处。阿贾克斯是荷兰最顶级的足球俱乐部之一，他们曾经在历史上拿到过34座联赛冠军，同时在欧战赛场上也是战果显赫。可亚特兰大呢？他们只不过是生存在贝尔加莫的一支小球队，他们甚至在欧冠连自己的主场都没有，只能借用圣西罗球场。&lt;/p&gt;\n&lt;p&gt;上赛季阿贾克斯虽然和亚特兰大一样重视年轻人，但那支球队中已经有了多名超级新星，德容德利赫特就是最好的代表，可是亚特兰大呢？除了帕普&middot;戈麦斯算得上是一个人物，就没有真正意义上拿得出手可以让豪门疯抢的巨星。亚特兰大更多靠的是整体足球，是加斯佩里尼给这支球队灌输的理念，是相互之间呼应，彼此帮助的足球理念。&lt;/p&gt;\n&lt;p&gt;&lt;img title=&quot;1576161295049081799.jpg&quot; src=&quot;https://ygx.mynatapp.cc/fileService/preview/QlVTX0FDVElWSVRZXDIwMTktMTItMTJcQEBAMjI3MzI4MzU5NzI0NDgyNTYwLmpwZw==&quot; alt=&quot;3.jpg&quot; width=&quot;640&quot; height=&quot;359&quot; data-width=&quot;640&quot; data-height=&quot;359&quot; /&gt;&lt;/p&gt;\n&lt;p&gt;但又不得不说，两支球队又存在着相似之处。都知道阿贾克斯是荷兰的兵工厂，曾经为整个荷兰输送了无数的人才，而现在的亚特兰大同样是整个意甲青训工作做得最出色的球队，他们的青训值得所有的意甲球队学习，他们的球探同样遍布世界，和意甲其他球队相比工作更加努力。在他们的不断协作之下，如今亚特兰大也堪称是意甲的兵工厂，这里最近几年已经走出了多名球星，1900万转会尤文图斯的卡尔达拉，2500万转会的斯皮纳佐拉，2400万打包的孔蒂与凯西，2100万欧元加盟罗马的克里斯坦特以及2000万欧元加盟罗马的詹卢卡&middot;曼奇尼。&lt;/p&gt;\n&lt;p&gt;如今亚特兰大又有一批新人涌现出来，德罗恩、弗罗伊勒、戈利尼都已经挑起了大梁，他们也逐渐开始受到其他球队的关注，虽然不是豪门，但至少对于这支贝尔加莫球队而言，这一年他们的收入势必将会因为欧冠的晋级而大增，同时俱乐部管理层也需要衡量，接下来到底是继续走卖人路线，还是留下他们希望在接下来几年里都成为欧冠常客，这需要好好考量一番。&lt;/p&gt;, 操作员=1, 活动标题=2019年12月12日23:23:34, ID=227325314148073472},更新后:{更新时间=2019-12-13 00:02:37, 活动内容=&lt;p&gt;&lt;strong&gt;体坛周报全媒体记者 宁穆&lt;/strong&gt;&lt;/p&gt;\n&lt;p&gt;在最后一轮和顿涅茨克矿工的比赛之前，不会有多少人相信，亚特兰大会成为欧冠十六强中的一员，感谢这支意大利球队，让本赛季欧冠淘汰赛真正变成了五大联赛的舞台。在加斯佩里尼带领着球队疯狂庆祝的同时，也有很多人回归现实给亚特兰大泼冷水，认为他们是淘汰赛中的大礼包，任何一支球队抽到他们都可以轻松晋级，但真的是这样吗？这支球队能否复制上赛季阿贾克斯的神奇？&lt;/p&gt;\n&lt;p&gt;&lt;img title=&quot;1576161264884097929.jpg&quot; src=&quot;https://ygx.mynatapp.cc/fileService/preview/QlVTX0FDVElWSVRZXDIwMTktMTItMTJcQEBAMjI3MzI4Mjk4MDE3ODgyMTEyLmpwZw==&quot; alt=&quot;21321.jpg&quot; width=&quot;640&quot; height=&quot;360&quot; data-width=&quot;640&quot; data-height=&quot;360&quot; /&gt;&lt;/p&gt;\n&lt;p&gt;贝尔加莫的所有球迷们至今还沉浸在亚特兰大出线的疯狂之中，他们为自己热爱的这支球队而自豪，更为整个意大利足坛出了这样一支神奇的队伍感到骄傲，他们不仅是意大利足坛这么多年在欧冠历史上的一个奇迹，同时也是整个欧冠史上的奇迹。毕竟在欧冠联赛的历史上还从未有过一支球队在前三轮比赛一分未得的情况下最终出线，亚特兰大人做到了，他们弥补了意大利足球的遗憾，也用自己的经历告诉着所有的欧冠门外汉们：只要相信奇迹，一切都可能发生。&lt;/p&gt;\n&lt;p&gt;这一夜这支蓝黑色的球队相比国际米兰在全世界吸了更多的粉丝，也获得了更高的知名度和尊重度，很多疯狂的球迷们已经开始期待，期待着这支球队可以效仿上赛季的阿贾克斯，一路高歌猛进，淘汰所有的豪门，走得更远。的确，上赛季的阿贾克斯确实给我们带来了奇迹，从淘汰皇家马德里到淘汰尤文图斯甚至险些杀入决赛，阿贾克斯的荷兰童话是否可以在亚特兰大身上重演？&lt;/p&gt;\n&lt;p&gt;&lt;img title=&quot;1576161259421068022.jpg&quot; src=&quot;https://ygx.mynatapp.cc/fileService/preview/QlVTX0FDVElWSVRZXDIwMTktMTItMTJcQEBAMjI3MzI4MzMyNjU4NjM4ODQ4LmpwZw==&quot; alt=&quot;213.jpg&quot; width=&quot;640&quot; height=&quot;341&quot; data-width=&quot;640&quot; data-height=&quot;341&quot; /&gt;&lt;/p&gt;\n&lt;p&gt;其实阿贾克斯与亚特兰大之间还是有太多的不同，这让两支球队在理论上并没有可比之处。阿贾克斯是荷兰最顶级的足球俱乐部之一，他们曾经在历史上拿到过34座联赛冠军，同时在欧战赛场上也是战果显赫。可亚特兰大呢？他们只不过是生存在贝尔加莫的一支小球队，他们甚至在欧冠连自己的主场都没有，只能借用圣西罗球场。&lt;/p&gt;\n&lt;p&gt;上赛季阿贾克斯虽然和亚特兰大一样重视年轻人，但那支球队中已经有了多名超级新星，德容德利赫特就是最好的代表，可是亚特兰大呢？除了帕普&middot;戈麦斯算得上是一个人物，就没有真正意义上拿得出手可以让豪门疯抢的巨星。亚特兰大更多靠的是整体足球，是加斯佩里尼给这支球队灌输的理念，是相互之间呼应，彼此帮助的足球理念。&lt;/p&gt;\n&lt;p&gt;&lt;img title=&quot;1576161295049081799.jpg&quot; src=&quot;https://ygx.mynatapp.cc/fileService/preview/QlVTX0FDVElWSVRZXDIwMTktMTItMTJcQEBAMjI3MzI4MzU5NzI0NDgyNTYwLmpwZw==&quot; alt=&quot;3.jpg&quot; width=&quot;640&quot; height=&quot;359&quot; data-width=&quot;640&quot; data-height=&quot;359&quot; /&gt;&lt;/p&gt;\n&lt;p&gt;但又不得不说，两支球队又存在着相似之处。都知道阿贾克斯是荷兰的兵工厂，曾经为整个荷兰输送了无数的人才，而现在的亚特兰大同样是整个意甲青训工作做得最出色的球队，他们的青训值得所有的意甲球队学习，他们的球探同样遍布世界，和意甲其他球队相比工作更加努力。在他们的不断协作之下，如今亚特兰大也堪称是意甲的兵工厂，这里最近几年已经走出了多名球星，1900万转会尤文图斯的卡尔达拉，2500万转会的斯皮纳佐拉，2400万打包的孔蒂与凯西，2100万欧元加盟罗马的克里斯坦特以及2000万欧元加盟罗马的詹卢卡&middot;曼奇尼。&lt;/p&gt;\n&lt;p&gt;如今亚特兰大又有一批新人涌现出来，德罗恩、弗罗伊勒、戈利尼都已经挑起了大梁，他们也逐渐开始受到其他球队的关注，虽然不是豪门，但至少对于这支贝尔加莫球队而言，这一年他们的收入势必将会因为欧冠的晋级而大增，同时俱乐部管理层也需要衡量，接下来到底是继续走卖人路线，还是留下他们希望在接下来几年里都成为欧冠常客，这需要好好考量一番。&lt;/p&gt;, 操作员=1, 活动标题=2019年12月12日23:23:34, ID=227325314148073472}');
INSERT INTO `sys_log_text` VALUES ('227336675313844224', '227336675288678400', '更新活动,更新前:{状态=启用, 录入时间=2019-12-12 23:23:43, 更新时间=2019-12-13 00:02:37, 活动内容=&lt;p&gt;&lt;strong&gt;体坛周报全媒体记者 宁穆&lt;/strong&gt;&lt;/p&gt;\n&lt;p&gt;在最后一轮和顿涅茨克矿工的比赛之前，不会有多少人相信，亚特兰大会成为欧冠十六强中的一员，感谢这支意大利球队，让本赛季欧冠淘汰赛真正变成了五大联赛的舞台。在加斯佩里尼带领着球队疯狂庆祝的同时，也有很多人回归现实给亚特兰大泼冷水，认为他们是淘汰赛中的大礼包，任何一支球队抽到他们都可以轻松晋级，但真的是这样吗？这支球队能否复制上赛季阿贾克斯的神奇？&lt;/p&gt;\n&lt;p&gt;&lt;img title=&quot;1576161264884097929.jpg&quot; src=&quot;https://ygx.mynatapp.cc/fileService/preview/QlVTX0FDVElWSVRZXDIwMTktMTItMTJcQEBAMjI3MzI4Mjk4MDE3ODgyMTEyLmpwZw==&quot; alt=&quot;21321.jpg&quot; width=&quot;640&quot; height=&quot;360&quot; data-width=&quot;640&quot; data-height=&quot;360&quot; /&gt;&lt;/p&gt;\n&lt;p&gt;贝尔加莫的所有球迷们至今还沉浸在亚特兰大出线的疯狂之中，他们为自己热爱的这支球队而自豪，更为整个意大利足坛出了这样一支神奇的队伍感到骄傲，他们不仅是意大利足坛这么多年在欧冠历史上的一个奇迹，同时也是整个欧冠史上的奇迹。毕竟在欧冠联赛的历史上还从未有过一支球队在前三轮比赛一分未得的情况下最终出线，亚特兰大人做到了，他们弥补了意大利足球的遗憾，也用自己的经历告诉着所有的欧冠门外汉们：只要相信奇迹，一切都可能发生。&lt;/p&gt;\n&lt;p&gt;这一夜这支蓝黑色的球队相比国际米兰在全世界吸了更多的粉丝，也获得了更高的知名度和尊重度，很多疯狂的球迷们已经开始期待，期待着这支球队可以效仿上赛季的阿贾克斯，一路高歌猛进，淘汰所有的豪门，走得更远。的确，上赛季的阿贾克斯确实给我们带来了奇迹，从淘汰皇家马德里到淘汰尤文图斯甚至险些杀入决赛，阿贾克斯的荷兰童话是否可以在亚特兰大身上重演？&lt;/p&gt;\n&lt;p&gt;&lt;img title=&quot;1576161259421068022.jpg&quot; src=&quot;https://ygx.mynatapp.cc/fileService/preview/QlVTX0FDVElWSVRZXDIwMTktMTItMTJcQEBAMjI3MzI4MzMyNjU4NjM4ODQ4LmpwZw==&quot; alt=&quot;213.jpg&quot; width=&quot;640&quot; height=&quot;341&quot; data-width=&quot;640&quot; data-height=&quot;341&quot; /&gt;&lt;/p&gt;\n&lt;p&gt;其实阿贾克斯与亚特兰大之间还是有太多的不同，这让两支球队在理论上并没有可比之处。阿贾克斯是荷兰最顶级的足球俱乐部之一，他们曾经在历史上拿到过34座联赛冠军，同时在欧战赛场上也是战果显赫。可亚特兰大呢？他们只不过是生存在贝尔加莫的一支小球队，他们甚至在欧冠连自己的主场都没有，只能借用圣西罗球场。&lt;/p&gt;\n&lt;p&gt;上赛季阿贾克斯虽然和亚特兰大一样重视年轻人，但那支球队中已经有了多名超级新星，德容德利赫特就是最好的代表，可是亚特兰大呢？除了帕普&middot;戈麦斯算得上是一个人物，就没有真正意义上拿得出手可以让豪门疯抢的巨星。亚特兰大更多靠的是整体足球，是加斯佩里尼给这支球队灌输的理念，是相互之间呼应，彼此帮助的足球理念。&lt;/p&gt;\n&lt;p&gt;&lt;img title=&quot;1576161295049081799.jpg&quot; src=&quot;https://ygx.mynatapp.cc/fileService/preview/QlVTX0FDVElWSVRZXDIwMTktMTItMTJcQEBAMjI3MzI4MzU5NzI0NDgyNTYwLmpwZw==&quot; alt=&quot;3.jpg&quot; width=&quot;640&quot; height=&quot;359&quot; data-width=&quot;640&quot; data-height=&quot;359&quot; /&gt;&lt;/p&gt;\n&lt;p&gt;但又不得不说，两支球队又存在着相似之处。都知道阿贾克斯是荷兰的兵工厂，曾经为整个荷兰输送了无数的人才，而现在的亚特兰大同样是整个意甲青训工作做得最出色的球队，他们的青训值得所有的意甲球队学习，他们的球探同样遍布世界，和意甲其他球队相比工作更加努力。在他们的不断协作之下，如今亚特兰大也堪称是意甲的兵工厂，这里最近几年已经走出了多名球星，1900万转会尤文图斯的卡尔达拉，2500万转会的斯皮纳佐拉，2400万打包的孔蒂与凯西，2100万欧元加盟罗马的克里斯坦特以及2000万欧元加盟罗马的詹卢卡&middot;曼奇尼。&lt;/p&gt;\n&lt;p&gt;如今亚特兰大又有一批新人涌现出来，德罗恩、弗罗伊勒、戈利尼都已经挑起了大梁，他们也逐渐开始受到其他球队的关注，虽然不是豪门，但至少对于这支贝尔加莫球队而言，这一年他们的收入势必将会因为欧冠的晋级而大增，同时俱乐部管理层也需要衡量，接下来到底是继续走卖人路线，还是留下他们希望在接下来几年里都成为欧冠常客，这需要好好考量一番。&lt;/p&gt;, 操作员=1, 活动标题=2019年12月12日23:23:34, ID=227325314148073472},更新后:{更新时间=2019-12-13 00:08:36, 活动内容=&lt;p&gt;&lt;strong&gt;体坛周报全媒体记者 宁穆&lt;/strong&gt;&lt;/p&gt;\n&lt;p&gt;在最后一轮和顿涅茨克矿工的比赛之前，不会有多少人相信，亚特兰大会成为欧冠十六强中的一员，感谢这支意大利球队，让本赛季欧冠淘汰赛真正变成了五大联赛的舞台。在加斯佩里尼带领着球队疯狂庆祝的同时，也有很多人回归现实给亚特兰大泼冷水，认为他们是淘汰赛中的大礼包，任何一支球队抽到他们都可以轻松晋级，但真的是这样吗？这支球队能否复制上赛季阿贾克斯的神奇？&lt;/p&gt;\n&lt;p&gt;&lt;img title=&quot;1576161264884097929.jpg&quot; src=&quot;https://ygx.mynatapp.cc/fileService/preview/QlVTX0FDVElWSVRZXDIwMTktMTItMTJcQEBAMjI3MzI4Mjk4MDE3ODgyMTEyLmpwZw==&quot; alt=&quot;21321.jpg&quot; width=&quot;640&quot; height=&quot;360&quot; data-width=&quot;640&quot; data-height=&quot;360&quot; /&gt;&lt;/p&gt;\n&lt;p&gt;贝尔加莫的所有球迷们至今还沉浸在亚特兰大出线的疯狂之中，他们为自己热爱的这支球队而自豪，更为整个意大利足坛出了这样一支神奇的队伍感到骄傲，他们不仅是意大利足坛这么多年在欧冠历史上的一个奇迹，同时也是整个欧冠史上的奇迹。毕竟在欧冠联赛的历史上还从未有过一支球队在前三轮比赛一分未得的情况下最终出线，亚特兰大人做到了，他们弥补了意大利足球的遗憾，也用自己的经历告诉着所有的欧冠门外汉们：只要相信奇迹，一切都可能发生。&lt;/p&gt;\n&lt;p&gt;这一夜这支蓝黑色的球队相比国际米兰在全世界吸了更多的粉丝，也获得了更高的知名度和尊重度，很多疯狂的球迷们已经开始期待，期待着这支球队可以效仿上赛季的阿贾克斯，一路高歌猛进，淘汰所有的豪门，走得更远。的确，上赛季的阿贾克斯确实给我们带来了奇迹，从淘汰皇家马德里到淘汰尤文图斯甚至险些杀入决赛，阿贾克斯的荷兰童话是否可以在亚特兰大身上重演？&lt;/p&gt;\n&lt;p&gt;&lt;img title=&quot;1576161259421068022.jpg&quot; src=&quot;https://ygx.mynatapp.cc/fileService/preview/QlVTX0FDVElWSVRZXDIwMTktMTItMTJcQEBAMjI3MzI4MzMyNjU4NjM4ODQ4LmpwZw==&quot; alt=&quot;213.jpg&quot; width=&quot;640&quot; height=&quot;341&quot; data-width=&quot;640&quot; data-height=&quot;341&quot; /&gt;&lt;/p&gt;\n&lt;p&gt;其实阿贾克斯与亚特兰大之间还是有太多的不同，这让两支球队在理论上并没有可比之处。阿贾克斯是荷兰最顶级的足球俱乐部之一，他们曾经在历史上拿到过34座联赛冠军，同时在欧战赛场上也是战果显赫。可亚特兰大呢？他们只不过是生存在贝尔加莫的一支小球队，他们甚至在欧冠连自己的主场都没有，只能借用圣西罗球场。&lt;/p&gt;\n&lt;p&gt;上赛季阿贾克斯虽然和亚特兰大一样重视年轻人，但那支球队中已经有了多名超级新星，德容德利赫特就是最好的代表，可是亚特兰大呢？除了帕普&middot;戈麦斯算得上是一个人物，就没有真正意义上拿得出手可以让豪门疯抢的巨星。亚特兰大更多靠的是整体足球，是加斯佩里尼给这支球队灌输的理念，是相互之间呼应，彼此帮助的足球理念。&lt;/p&gt;\n&lt;p&gt;&lt;img title=&quot;1576161295049081799.jpg&quot; src=&quot;https://ygx.mynatapp.cc/fileService/preview/QlVTX0FDVElWSVRZXDIwMTktMTItMTJcQEBAMjI3MzI4MzU5NzI0NDgyNTYwLmpwZw==&quot; alt=&quot;3.jpg&quot; width=&quot;640&quot; height=&quot;359&quot; data-width=&quot;640&quot; data-height=&quot;359&quot; /&gt;&lt;/p&gt;\n&lt;p&gt;但又不得不说，两支球队又存在着相似之处。都知道阿贾克斯是荷兰的兵工厂，曾经为整个荷兰输送了无数的人才，而现在的亚特兰大同样是整个意甲青训工作做得最出色的球队，他们的青训值得所有的意甲球队学习，他们的球探同样遍布世界，和意甲其他球队相比工作更加努力。在他们的不断协作之下，如今亚特兰大也堪称是意甲的兵工厂，这里最近几年已经走出了多名球星，1900万转会尤文图斯的卡尔达拉，2500万转会的斯皮纳佐拉，2400万打包的孔蒂与凯西，2100万欧元加盟罗马的克里斯坦特以及2000万欧元加盟罗马的詹卢卡&middot;曼奇尼。&lt;/p&gt;\n&lt;p&gt;如今亚特兰大又有一批新人涌现出来，德罗恩、弗罗伊勒、戈利尼都已经挑起了大梁，他们也逐渐开始受到其他球队的关注，虽然不是豪门，但至少对于这支贝尔加莫球队而言，这一年他们的收入势必将会因为欧冠的晋级而大增，同时俱乐部管理层也需要衡量，接下来到底是继续走卖人路线，还是留下他们希望在接下来几年里都成为欧冠常客，这需要好好考量一番。&lt;/p&gt;, 操作员=1, 活动标题=神奇亚特兰大成意甲典范 他们与上季贾府有何不同, ID=227325314148073472}');
