INSERT INTO `sys_log_text` VALUES ('227337118098128896', '227337118072963072', '添加活动:{状态=启用, 录入时间=2019-12-13 00:10:22, 更新时间=2019-12-13 00:10:22, 活动内容=&lt;p&gt;&lt;img src=&quot;https://imgs.aixifan.com/o_1drt8bg7ccu63pi1clpuk61vgt7.jpg&quot; data-width=&quot;769&quot; data-height=&quot;637&quot; /&gt;&lt;/p&gt;\n&lt;p&gt;直播吧12月12日讯 《每日体育报》消息，瑞典前锋伊布位于马尔默的雕像再遭破坏，有人试图锯断雕像的腿。&lt;/p&gt;\n&lt;p&gt;伊布因为购买了马尔默对手哈马比的股份而遭到极端球迷报复，他们拿伊布位于家乡的雕像撒气。&lt;/p&gt;\n&lt;p&gt;有极端球迷试图锯断雕像的腿，马尔默当局检查后发现，他的雕像不会因此立刻倒塌，警方正调查此事，但还没有找到嫌疑人。&lt;/p&gt;\n&lt;p&gt;伊布离开洛杉矶银河后，成为自由球员。《每体》称他即将回归AC米兰，2010-2012年期间，他曾效力过米兰。目前双方还在商讨待遇和延长合同的问题。&lt;/p&gt;\n&lt;p&gt;不满伊布入股竞争对手哈马比，马尔默极端球迷焚烧伊布雕像&lt;/p&gt;\n&lt;p&gt;（汤圆）&lt;/p&gt;, 操作员=1, 活动标题=每体：极端球迷再次发动破坏，试图锯断伊布雕像的腿, ID=227336891228225536}');
