INSERT INTO `sys_value_record` VALUES ('227337106341494784', '1', 'SYS_FILE', '227337105099980800', NULL, '{\"SF_NAME\":\"227337105099980800.jpg\",\"SF_TABLE_NAME\":\"BUS_ACTIVITY\",\"SF_SEE_TYPE\":1,\"SVR_TABLE_NAME\":\"SYS_FILE\",\"SO_ID\":\"1\",\"SF_PATH\":\"BUS_ACTIVITY\\\\2019-12-13\\\\\",\"SF_ORIGINAL_NAME\":\"o_1drt8bg7ccu63pi1clpuk61vgt7.jpg\",\"SF_SDT_CODE\":\"BUS_FILE_DEFAULT\",\"SF_ENTRY_TIME\":\"2019-12-13 00:10:19\",\"SF_SDI_CODE\":\"DEFAULT\",\"SF_SIZE\":416321,\"ID\":\"227337105099980800\",\"SF_SUFFIX\":\"jpg\",\"SF_TABLE_ID\":\"227336891228225536\"}', '2019-12-13 00:10:19', 1);
INSERT INTO `sys_value_record` VALUES ('227337117968105472', '1', 'BUS_ACTIVITY', '227336891228225536', NULL, '{\"IS_STATUS\":1,\"SVR_TABLE_NAME\":\"BUS_ACTIVITY\",\"BA_ENTRY_TIME\":\"2019-12-13 00:10:22\",\"BA_UPDATE_TIME\":\"2019-12-13 00:10:22\",\"BA_CONTENT\":\"<p><img src=\\\"https://imgs.aixifan.com/o_1drt8bg7ccu63pi1clpuk61vgt7.jpg\\\" data-width=\\\"769\\\" data-height=\\\"637\\\" /></p>\\n<p>直播吧12月12日讯 《每日体育报》消息，瑞典前锋伊布位于马尔默的雕像再遭破坏，有人试图锯断雕像的腿。</p>\\n<p>伊布因为购买了马尔默对手哈马比的股份而遭到极端球迷报复，他们拿伊布位于家乡的雕像撒气。</p>\\n<p>有极端球迷试图锯断雕像的腿，马尔默当局检查后发现，他的雕像不会因此立刻倒塌，警方正调查此事，但还没有找到嫌疑人。</p>\\n<p>伊布离开洛杉矶银河后，成为自由球员。《每体》称他即将回归AC米兰，2010-2012年期间，他曾效力过米兰。目前双方还在商讨待遇和延长合同的问题。</p>\\n<p>不满伊布入股竞争对手哈马比，马尔默极端球迷焚烧伊布雕像</p>\\n<p>（汤圆）</p>\",\"SO_ID\":\"1\",\"BA_TITLE\":\"每体：极端球迷再次发动破坏，试图锯断伊布雕像的腿\",\"ID\":\"227336891228225536\"}', '2019-12-13 00:10:22', 1);
